    const[viewToShow, set_viewToShow]=useState('svgViewer');

    function changeView(){
       if(viewToShow="svgViewer") {
           viewToShow="landingPage"

       }

       if(viewToShow="landingPage") {
           viewToShow="svgViewer"

       }
    }

    function showView() {
        switch(viewToShow) {
            case 'svgViewer':
                  return  <SvgViewer />   

            case 'landingPage':
                  return <LandingPage />

            default:
                return <SvgViewer />

        }
    }

    return (
        <div>

{showView()}
        <button onClick={()=>changeView()}
        >change to landingPage</button>

        </div>
    )
} 
export default SplashPage
